import React from 'react'

export default function Cards( props ) {

    let options = props.options;
    let priceOptions = Object.keys( options )

    return (
        <div>
            <div className="card mt-5 mb-5" style={ { "width": "18rem", "maxHeight": "360px" } }>
                <img className="card-img-top" src="https://source.unsplash.com/random/1200x700/?idli" alt="Card image cap" />
                <div className="card-body">
                    <h5 className="card-title">{ props.foodName }</h5>
                    <div className="container w-100">

                        <select className='m-2 h-100 bg-success rounded'>
                            { Array.from( Array( 6 ), ( e, i ) => {
                                return (
                                    <option key={ i + 1 } value={ i + 1 } > { i + 1 }</option>
                                )
                            } ) }
                        </select>

                        <select className='m-2 h-100 bg-success rounded'>
                            { priceOptions.map( ( data ) => {
                                return <options key={ data } value={ data }>data</options>
                            } ) }
                        </select>

                        <div className='d-inline h-100 fs-5'>
                            Total Price
                        </div>

                    </div>
                </div>
            </div>
        </div>
    )
}
